  return (
    <div className="header">
      <div>
        <div className="total-products">0 Produk</div>
        <div className="total-price">{formatPrice(1)}</div>
      </div>
      <div className="button">Lanjutkan Pesanan</div>
    </div>
  );
}

export default Header;
